chment\":\"inherit\",\"global_background_position\":\"50% 50%\",\"global_use_overlay\":0,\"global_overlay_type\":\"overlay_none\",\"global_gradient_overlay\":{\"color\":\"rgba(127, 0, 255, 0.8)\",\"color2\":\"rgba(225, 0, 255, 0.7)\",\"deg\":\"45\",\"type\":\"linear\"},\"global_pattern_overlay\":{\"src\":\"\"},\"global_overlay_pattern_color\":\"\",\"blend_mode\":\"normal\",\"global_user_border\":0,\"global_border_width\":{\"xxl\":\"\",\"xl\":\"\",\"lg\":\"\",\"md\":\"\",\"sm\":\"\",\"xs\":\"\"},\"global_border_radius\":{\"xxl\":\"\",\"xl\":\"\",\"lg\":\"\",\"md\":\"\",\"sm\":\"\",\"xs\":\"\"},\"global_boxshadow\":\"0 0 0 0 #FFFFFF\",\"global_use_animation\":0,\"global_animationduration\":\"300\",\"global_animationdelay\":\"0\",\"class\":\"\",\"global_custom_css\":\"\",\"global_custom_position\":0,\"global_seclect_position\":\"relative\",\"global_addon_position_left\":{\"unit\":\"px\"},\"global_addon_position_top\":{\"unit\":\"px\"},\"use_global_width\":\"0\",\"hidden_xxl\":\"0\",\"hidden_xl\":\"0\",\"hidden_lg\":\"0\",\"hidden_md\":\"0\",\"hidden_sm\":\"0\",\"hidden_xs\":\"0\",\"acl\":\"\",\"admin_label\":\"\",\"while_scroll_view\":[{\"enable_while_scroll_view\":0,\"scrolling_options\":\"fullpage\",\"on_scroll_actions\":[{\"id\":\"b3fdc1c1e6bfde5942ea\",\"index\":0,\"keyframe\":0,\"name\":\"move\",\"property\":{\"x\":\"0\",\"y\":\"-100\",\"z\":\"0\"},\"range\":{\"max\":500,\"min\":-500,\"stop\":1},\"single\":true,\"title\":\"Move\"},{\"id\":\"936e0225e6dc8edfba7d\",\"index\":1,\"keyframe\":100,\"name\":\"move\",\"property\":{\"x\":0,\"y\":0,\"z\":0},\"range\":{\"max\":500,\"min\":-500,\"stop\":1},\"single\":true,\"title\":\"Move\"}],\"transition_origin_x\":\"center\",\"transition_origin_y\":\"center\",\"enable_tablet\":0,\"enable_mobile\":0}],\"mouse_movement\":[{\"enable_tilt_effect\":0,\"mouse_tilt_direction\":\"direct\",\"mouse_tilt_speed\":\"1\",\"mouse_tilt_max\":\"15\",\"enable_tablet\":0,\"enable_mobile\":0}],\"text\":\"<ol><li><strong>Kebijakan Pembatalan<\\/strong>: Jika Anda perlu membatalkan reservasi, kami meminta pemberitahuan setidaknya 48 jam sebelum waktu penjemputan. Pembatalan yang dilakukan kurang dari waktu tersebut akan dikenakan biaya pembatalan sebesar [jumlah biaya pembatalan].<\\/li><li><strong>Keterlambatan Pengembalian<\\/strong>: Kami menghargai waktu pelanggan kami, oleh karena itu jika kendaraan tidak dikembalikan pada waktu yang disepakati, biaya keterlambatan akan dikenakan. Biaya keterlambatan ini dihitung berdasarkan tarif harian dan akan dikenakan setiap jam keterlambatan.<\\/li><li><strong>Kerusakan Kendaraan<\\/strong>: Kami berharap Anda merawat kendaraan sewaan dengan baik. Jika terjadi kerusakan pada kendaraan yang melebihi keausan normal, Anda akan bertanggung jawab untuk membayar biaya perbaikan sesuai dengan tingkat kerusakan yang ditentukan oleh bengkel resmi.<br><\\/li><li><strong>Bahan Bakar<\\/strong>: Setiap kendaraan yang disewakan harus dikembalikan dengan level bahan bakar yang sama seperti saat penjemputan. Jika kendaraan dikembalikan dengan level bahan bakar yang lebih rendah, biaya pengisian bahan bakar akan dikenakan bersama dengan biaya administrasi tambahan.<br><\\/li><li><strong>Pelanggaran Lalu Lintas dan Tol<\\/strong>: Pelanggan bertanggung jawab untuk membayar semua pelanggaran lalu lintas atau biaya tol yang timbul selama periode penyewaan. Jika kami menerima tagihan terkait pelanggaran atau biaya tol, kami akan mengenakan biaya administrasi tambahan untuk mengurus proses pembayaran.<br><\\/li><li><strong>Kebersihan Kendaraan<\\/strong>: Kendaraan harus dikembalikan dalam keadaan bersih. Jika kendaraan dikembalikan dalam kondisi yang sangat kotor dan memerlukan pembersihan tambahan, biaya pembersihan akan dikenakan.<\\/li><li><strong>Modifikasi Kendaraan<\\/strong>: Pelanggan dilarang untuk melakukan modifikasi apa pun pada kendaraan sewaan tanpa persetujuan tertulis dari kami. Jika kendaraan mengalami modifikasi, biaya restorasi atau perbaikan yang diperlukan akan ditanggung oleh pelanggan.<\\/li><\\/ol>\",\"dropcap\":0,\"heading_selector\":\"h1\",\"title\":\"Penalti\",\"title_text_color\":\"#368bd6\"},\"icon\":\"<svg viewBox=\\\"0 0 32 32\\\" xmlns=\\\"http:\\/\\/www.w3.org\\/2000\\/svg\\\"><path d=\\\"M23.055 10.419c0-.885-.717-1.602-1.602-1.602H10.547a1.602 1.602 0 000 3.204h3.825v10.118a1.628 1.628 0 103.256 0V12.02h3.825c.885 0 1.602-.718 1.602-1.602z\\\" fill=\\\"currentColor\\\"\\/><path opacity=\\\".5\\\" fill-rule=\\\"evenodd\\\" clip-rule=\\\"evenodd\\\" d=\\\"M5.18 3.42c-.95 0-1.721.758-1.721 1.693V8.5c0 .668-.55 1.21-1.23 1.21A1.22 1.22 0 011 8.5V5.113C1 2.84 2.872 1 5.18 1h2.951c.68 0 1.23.542 1.23 1.21 0 .668-.55 1.21-1.23 1.21h-2.95zM26.82 28.58c.95 0 1.721-.758 1.721-1.693V23.5c0-.668.55-1.21 1.23-1.21.678 0 1.229.542 1.229 1.21v3.387C31 29.16 29.128 31 26.82 31h-2.951a1.22 1.22 0 01-1.23-1.21c0-.668.55-1.21 1.23-1.21h2.95zM26.82 3.42c.95 0 1.721.758 1.721 1.693V8.5c0 .668.55 1.21 1.23 1.21A1.22 1.22 0 0031 8.5V5.113C31 2.84 29.128 1 26.82 1h-2.951c-.68 0-1.23.542-1.23 1.21 0 .668.55 1.21 1.23 1.21h2.95zM5.18 28.58c-.95 0-1.721-.758-1.721-1.693V23.5c0-.668-.55-1.21-1.23-1.21A1.22 1.22 0 001 23.5v3.387C1 29.16 2.872 31 5.18 31h2.951a1.22 1.22 0 001.23-1.21c0-.668-.55-1.21-1.23-1.21h-2.95z\\\" fill=\\\"currentColor\\\"\\/><\\/svg>\",\"title\":\"Text Block\",\"parent\":false}],\"width\":{\"xxl\":\"100%\",\"xl\":\"100%\",\"lg\":\"100%\",\"md\":\"100%\",\"sm\":\"100%\",\"xs\":\"100%\"}}],\"parent\":false},{\"id\":1687768599298,\"visibility\":true,\"collapse\":false,\"settings\":{\"fit_columns\":{\"xl\":true,\"sm\":false},\"background_type\":\"none\",\"background_gradient\":{\"color\":\"#00c6fb\",\"color2\":\"#005bea\",\"deg\":\"45\",\"type\":\"linear\"},\"background_image\":{\"src\":\"\"},\"background_parallax\":\"0\",\"background_repeat\":\"no-repeat\",\"background_size\":\"cover\",\"background_size_custom\":{\"unit\":\"px\"},\"background_attachment\":\"fixed\",\"background_position\":\"0 0\",\"background_positio